import React, { Component } from 'react'
import { Row, Col } from 'antd';
import { Avatar } from 'antd';
class Testimonials extends Component {
    render() {
        return (
            <div className="col-24 sections section-5">
                <h1 className='title'>Testimonials</h1>
                <Row>
                    <Col  xs={12} sm={12} md={12} lg={12} className="column-padding" key="key1">
                        <div style={{width:420,height:'100%',padding:8,margin: '10px 15px', border: '3px solid #4f3949'}}>

                        </div>
                        <Avatar size={64} icon="user" /> 
                    </Col>
                    <Col  xs={12} sm={12} md={12} lg={12} className="column-padding" key="key2">
                        <Avatar size={64} icon="user" /> 
                    </Col>
                </Row>
 
            </div>
        )
    }
}

export default Testimonials
